import { _Finder } from "../../../stl-cmp";
import iSearch from '../../../img/search.svg';
import { search } from "../../../redux/actions/actions";
import { useState } from "react";
import { connect } from "react-redux";

const Finder = ({search}) => {
    const [value, setValue] = useState({
        search: ''
    })

    const searchChange = ({target: {name, value}})=>{
        (()=>{
            setValue(value)
        })()
        search(value)
    }

    return (
        <_Finder>
            <form action="">
            <label>
					<p>Busca un Can</p>
					<div>
						<input name='search' onChange={searchChange} type="text" value={value}/>
						<button>
							<object data={iSearch} type="image/svg+xml" />
						</button>
					</div>
				</label>
            </form>
        </_Finder>
    )
}

export default connect(null, {search})(Finder)
